var React = require("react")
var d3 = require("d3")

var TableBar = (props) => {
    return (
      <table className ="table">
        <tbody>
          {
            props.rows !== undefined ? props.rows.map((row, i) =>
              <tr key = {"row"+i}>
              {
                  <td key = {row.key}>{row.key} {console.log(row)}  </td>
              }
              </tr>
              ) : null
          }
        </tbody>

      </table>
      )
   }

export default TableBar
